import React from "react";
import { Outlet } from "react-router-dom";

function Index() {
  return (
    <div
      className="App bg"
      style={{ background: "url(/static/images/authbg.jpg)" }}
    >
      <Outlet />
    </div>
  );
}

export default Index;
